import React, { Component } from "react";
import barcelona from "../img/barcelona.png";
import amsterdam from "../img/amsterdam.png";
import newyork from "../img/newyork.png";
import Slider from "react-animated-slider";
import "react-animated-slider/build/horizontal.css";

class HomePagePhotoCycle extends Component {
  render() {
    return <div className="HomePagePhotoCycle" />;
    <Slider>
      {content.map((article, index) => (
        <div key={index}>
          <h2>{article.title}</h2>
          <div>{article.description}</div>
        </div>
      ))}
    </Slider>;
  }
}

export default HomePagePhotoCycle;
